import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import SunLogo from './sun-logo.png'

function NavbarMain() {
  return (
    <Navbar expand="lg" className="bg-dark" variant='dark'>
      <Container>
        <Navbar.Brand href="/">
            <img src={SunLogo} alt="" className='logo-navbar' />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link href="" className='fs-4'>Home</Nav.Link>
            <Nav.Link href="products" className='fs-4'>Products</Nav.Link>
            <Nav.Link href="contacts" className='fs-4'>Contact</Nav.Link>
            <Nav.Link href="about" className='fs-4'>About Us</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavbarMain;
